import React from 'react';
import './Navbar.css';
import {Link} from 'react-router-dom';

export default function Navbar(){
    return (
        <div>
            <div className='navbar'>
                <Link to = '/' className='navbarLink'>Home</Link>
                {/* <a href="#home">Home</a> */}
                <div className='align'>
                    <Link to='/con' className='navbarLink'>Contact</Link>
                    <Link to='/acc' className='navbarLink'>Account</Link>
                    {/* <a href="#contact">Contact</a>
                    <a href="#account" >Account</a> */}
                </div>
                <Link to='/best'>BestSelled</Link>
                {/* <a href='#bestsellers'>BestSelled</a> */}
                <div className='navbarLink'></div>
                <form className='alignr' id = "example">
                    <input type="text" className = 'navy' name="search" placeholder="Search.." />
                </form>
            </div>
        </div>
    )
}
